import React from "react";
//import { Navbar, NavbarBrand, Nav, NavDropdown } from "react-bootstrap";
import { AppBar, Toolbar, Button, Typography } from "@material-ui/core";

function HeadBar() {
  return (
    <AppBar position="static">
      <Typography>Test</Typography>
      <Toolbar>
        <Button color="inherit">Home</Button>
        <Button color="inherit">About Us</Button>
        <Button color="inherit">Information</Button>
        <Button color="inherit">Resources</Button>
        <Button color="inherit">Competitions</Button>
        <Button color="inherit" style={{display:"flex", justifyContent:"right"}}>Login</Button>
      </Toolbar>
    </AppBar>
  );
}

export default HeadBar;
